import { Component } from '@angular/core';
import { Router } from '@angular/router';
import { EComService } from 'src/app/e.com.service';

@Component({
  selector: 'app-register',
  templateUrl: './register.component.html',
  styleUrls: ['./register.component.css']
})
export class RegisterComponent {

  firstName!: string;
  lastName!: string;
  email!: string;
  userType!: string;
  dob!: Date;
  username!: string;
  password!: string;
  mobile!: string;
  address!: string;
  zipcode!: string;
  profileImage!: File;
  state!: string;
  country!: string;

  registrationData:any=[];

 constructor(private router:Router, private service:EComService){}

register(){
 this.service.registerUser(this.registrationData).subscribe({
  next:(response) =>{
    console.log(response);
    this.redirectToLogin
  },
  error:(error)=>
     console.error(error);

 }
 )


}

onFileSelected(event:any){}



redirectToLogin(){
  this.router.navigate(['/login']);
}

}
